def value_iteration(env, gamma=0.99):
    '''
    Code your value iteration algorithms here, the function should return a np 
    array of dimensions (10, 10, 2^(no. of sub-goals)). Also return the final
    policy grid corresponding to the final values.
    '''
    # extracting no. of subgoals
    n = len(env.subgoal_reward)
    n2 = 2**n
    # Initial Values
    values = np.zeros((10, 10, n2))
    # Initial policy
    policy = np.empty((10, 10, n2), object)
    policy[:] = 'N' # Make all the policy values as 'N'
    # Begin code here
    # Used pseudo code for Gauss-Seidel Value Iteration
    extra_info = {}
    num_of_subgoals = len(env.subgoal_location)
    begin= time.time()
    possible_actions = list(env.actions.keys())
    while True:
      delta = 0
      for i in range(10):
        for j in range(10):
          for k in range(n2):
            state = ([i,j],num2binv(k, n = num_of_subgoals))
            v = values[i,j,k]
            A = {a:0 for a in possible_actions} # check if limited actions is possible
            for a in A.keys():
                for new_state, prob, reward in env.get_transition_probabilites_and_reward(state,a):  # new_state, probab, reward
                  A[a] += prob * (reward + gamma * values[new_state[0][0], new_state[0][1], binv2num(new_state[1])])
            best_action = max(A, key = lambda x: A[x])
            Js = A[best_action]
            delta = max(delta, np.abs(v - Js))
            values[i,j,k] = Js 
            policy[i,j,k] = best_action 
      if delta < 1e-5:
        break
    end = time.time()
    print(end-begin)    
