def policy_iteration(env, gamma=0.99):
    '''
    Code a policy iteration algorithms here, the function should return a np 
    array of dimensions (10, 10, 2^(no. of sub-goals)) as the value gird and
    the final policy grid corresponding to the final values.
    '''

    # extracting no. of subgoals
    n = len(env.subgoal_reward)
    n2 = 2**n

    # Initial Values
    values = np.zeros((10, 10, n2))

    # Initial policy
    policy = np.empty((10, 10, n2), object)
    policy[:] = 'N' # Make all the policy values as 'N'
    ### Begin your code below this line
    num_of_subgoals = len(env.subgoal_location)
    possible_actions = list(env.actions.keys())
    while True:
      while True:
        delta =0
        for i in range(10):
          for j in range(10):
            for k in range(n2):
              state = ([i,j],num2binv(k, n = num_of_subgoals))
              v = 0
              for new_state, prob, reward in env.get_transition_probabilites_and_reward(state, policy[i,j,k]):  # new_state, probab, reward
                v += prob * (reward + gamma * values[new_state[0][0], new_state[0][1], binv2num(new_state[1])])
              delta = max(delta, np.abs(v - values[i,j,k]))
              values[i,j,k] = v
        if delta < 1e-5:
          break
      done = 1
      # print('Round done')
      for i in range(10):
        for j in range(10):
          for k in range(n2):
            old_action = policy[i,j,k] 
            state = ([i,j],num2binv(k, n = num_of_subgoals))
            A = {a:0 for a in possible_actions} # check if limited actions is possible
            for a in A:
                for new_state, prob, reward in env.get_transition_probabilites_and_reward(state,a):  # new_state, probab, reward
                  A[a] += prob * (reward + gamma * values[new_state[0][0], new_state[0][1],  binv2num(new_state[1])])
            best_action = max(A, key = lambda x: A[x])
            policy[i,j,k] = best_action
            if old_action != best_action:
              done =0
      if done ==1:
        break


    # Put your extra information needed for plots etc in this dictionary
    extra_info = {
    }

    # End code

    # Do not change the number of output values
    return {"Values": values, "Policy": policy}, extra_info

